import React from 'react';
import { Box } from '@mui/material';

const Logo = () => (
  <Box sx={{ display: 'inline-block', mr: 1 }}>
    <img src="/gogetwell-logo-white.png" alt="GoGetWell AI Logo" style={{ height: 38, width: 'auto', background: 'transparent' }} />
  </Box>
);

export default Logo;
